import React from "react";
import { Switch , Route} from "react-router-dom";
import "./index.css";
import Home from "./Home";
import Service from "./Service";
import About from "./About";
import Contact from "./Contact";
import Navbar from "./Navbar";



const App = () =>{
    return (
        <>
        <Switch>
            <Route></Route>
            <Route></Route>
            <Route></Route>
            <Route></Route>
            <Route></Route>
        </Switch>

        </>
    )
}

export default App;
